import React from 'react'
import {
    MDBBtn,
    MDBContainer,
    MDBCard,
    MDBCardBody,
    MDBInput,
    MDBCheckbox
  }
    from 'mdb-react-ui-kit';
  import './Signup.css';

const Signup = () => {
  return (
    <>
     <section className="signup">
        <div className="container mt-5">
            <div className="signup-content"></div>
        </div>
     </section>
    </>
  )
}



export default Signup
